const Favs = () => {

  return (
    <div>
      <h1>Odont√≥logos favoritos</h1>
      <div className={state.theme == 'light' ? "light main" : "dark main"}>
      {state.favs.length == 0 ? 
        <h2>There are no dentists in Favorites</h2> :
        state.favs.map((fav) => 
        <Card key={fav.id} name={fav.name} username={fav.username} id={fav.id}/>)}
